script: |
  super -f text -I q4991.spq | sort > q4991.out

inputs:
  - name: q4991.spq
    data: |
      SELECT + col0 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT 35 + col1 NOT BETWEEN ( - col0 - col2 ) AND + 64 * 69 - + 40;
  - name: tab2

outputs:
  - name: q4991.out
    data: |
      46
      64
      75
